    console.log(' props', props);

}


  render() {

    const score = this.props.scores.map((scoreEntry, i) => {
        return (<tl key={i}> <th>{scoreEntry.name}</th> <th>{scoreEntry.score}</th></tl>)
    })

    return (
      <div>
        {score}
      </div>
    )
  }
}
